request.description:
Método para consultar a lista de grupos de categorias. Na listagem, além do ID de idenificação de cada grupo, é possível encontrar:
- o posicionamento do grupo na listagem;
- o nome do grupo; 
- as categorias que pertencem ao grupo (no atributo 'categs' estão todas as categorias do grupo, cada uma delas com dois dígitos).
